import React from 'react';
import './App.css';



function Footer(){
    return(
        <div className="App-footer">
        <a
          className="App-link"
          href="https://wearecodenation.com/courses/coding/master/"
          target="_blank"
          rel="noopener noreferrer">
          Code Nation
        </a>
        <a
        className="App-link"
          href="http://www.open.ac.uk/"
          target="_blank"
          rel="noopener noreferrer">
          The Open University
        </a>
      </div>
    )
}

export default Footer;
